webpackJsonp([46671713657090],{444:function(A,a){A.exports={data:{site:{siteMetadata:{title:"しれせせ",author:"shiresese"}},markdownRemark:{id:"/Users/se/Documents/GitHub/srss/src/pages/posts/c94/index.md absPath of file >>> MarkdownRemark",html:'<p>C94 の情報です。<br>「しれせせ」は1日目の <strong>2018/8/10(金曜日) 「よ08b」</strong> にスペースをいただいております。</p>\n<p>新刊情報ですが、</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 103.36134453781511%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dmns"\n        title=""\n        src="/static/dmns-03784b4511ba6c82362c8b091837b38e-a408b.png"\n        srcset="/static/dmns-03784b4511ba6c82362c8b091837b38e-4eabf.png 148w,\n/static/dmns-03784b4511ba6c82362c8b091837b38e-5a375.png 295w,\n/static/dmns-03784b4511ba6c82362c8b091837b38e-a408b.png 590w,\n/static/dmns-03784b4511ba6c82362c8b091837b38e-1d639.png 833w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  <br>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dmns_photo"\n        title=""\n        src="/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-ca545.jpg"\n        srcset="/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-aa1b7.jpg 148w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-b937a.jpg 295w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-ca545.jpg 590w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-75639.jpg 885w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-8bd51.jpg 1180w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-a3716.jpg 1770w,\n/static/dmns_photo-10bc1cb35c4d92442f954bbae332c9dd-9feab.jpg 2048w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p>と言う感じで、<a href="../../products/damenose/">人を駄目にする一ノ瀬ラバーストラップ</a>を作りました。</p>\n<p>まだ一作しか出せてないゲームのグッズを自作していくスタイル……あまりにマーケットが小さい……</p>\n<p>今回も2が間に合わなかったためこんなことになったわけなんですが、モノ自体はなかなかに良いものができたので、興味がある方はぜひ。<br>おそらく500円。</p>\n<p>それから、毎度のごとくゲームの既刊も01のサウンドトラックも持っていきます。<br>そちらも合わせてよろしくお願いします。</p>\n<hr>\n<p>次回こそは出す出す詐欺をやめてゲームの本編を出したいです。<br>進捗はしているのでいずれは出るんですが……あまりにも進捗が遅い……</p>\n<p>とりあえず、もう既刊を増刷したくない。</p>\n<p>冬に向けて頑張ります(そろそろ落選しそう)。</p>',frontmatter:{title:"C94",date:"Invalid date"}}},pathContext:{slug:"/posts/c94/"}}}});
